import React, { Component } from 'react';
import {
    Row, Col, CardImg
} from 'reactstrap';

class Header extends Component{

    constructor(props) {
		super(props);
		this.toggle = this.toggle.bind(this);
		this.state = {
            isOpen:true,
		  dropdownOpen: false
		};
	}

	toggle() {
		this.setState({
		  dropdownOpen: !this.state.dropdownOpen,
		});
	}

	render(){
        const pos = {
                        barr:{size: 10, offset: 1},
                        logo:"1",
                        barSerch:"11"
                    }
		return(
			<Row>
                <Col xs={pos.barr} sm={pos.barr} md={pos.barr}>
                    <Row>
                        <Col xs={pos.logo} sm={pos.logo} md={pos.logo}>
                            <CardImg top width="100%" src="/assets/318x180.svg" alt="Card image cap" />
                        </Col>
                        <Col xs={pos.barSerch} sm={pos.barSerch} md={pos.barSerch} className="bg-primary">d</Col>
                    </Row>
                </Col>
            </Row>
		)
	}
}

export default Header;
